// Parse string to Currency
func Parse(n string) (Currency, error) {
	if c, ok := NameCurrency[strings.ToUpper(n)]; ok {
		return c, nil
	}
	return Currency{}, fmt.Errorf("unknown currency %q", n)
}

// UnmarshalJSON implements json.Unmarshaler interface
func (c *Currency) UnmarshalJSON(data []byte) error {
	sdata := string(data)
	if len(sdata) > 1 && sdata[0] == '"' {
		sdata = sdata[1 : len(sdata)-1]
	}
	cur, err := Parse(sdata)
	if err != nil {
		return err
	}
	*c = cur

	return nil
}

// MarshalJSON implements json.Marshaler interface
func (c Currency) MarshalJSON() ([]byte, error) {

	return []byte(strconv.Quote(c.Code)), nil
}
